import React from "react";
import './works.css';
import portfolio1 from '../../assets/portfolio-1.png';
import portfolio2 from '../../assets/portfolio-2.png';
import portfolio3 from '../../assets/portfolio-3.png';
import portfolio4 from '../../assets/portfolio-4.png';
import portfolio5 from '../../assets/portfolio-5.png';
import portfolio6 from  '../../assets/portfolio-6.png';

function Works(){
    return(
        <section id="works">
            <h2 className="worktitle"></h2>
            <span className="workDesc">Lorem ipsum dolor sit, amet consectetur adipisicing elit. Expedita harum animi incidunt tenetur dolores obcaecati dignissimos corrupti.</span>
            <div className="workImgs">
                <img src={portfolio1} alt="" className="workImg" />
                <img src={portfolio2} alt="" className="workImg" />
                <img src={portfolio3} alt="" className="workImg" />
                <img src={portfolio4} alt="" className="workImg" />
                <img src={portfolio5} alt="" className="workImg" />
                <img src={portfolio6} alt="" className="workImg" />
            </div>
        </section> 
    )
}
export default Works;
